import { Link } from "react-router-dom";

function Menu({ name }) {
    const kalar = "p-5 m-2 text-xl font-bold hover:text-blue-800 ";
    return (
        <Link to="/summary"><span className={kalar}>{name}</span></Link>
    );
}
const menuName = [
    "Home", 
    "Committee",
    "Boards",
    "Madrasas", 
    "Works", 
    "Exam", 
    "Publications", 
    "Dawnload", 
    "About", 
    "Contact", 
    "Recruitment"
]
const navbar = menuName.map(x => <Menu name={x}/>);
function MenuBar() {
    return(
        <div className="w-full h-full">
            <div className="flex flex-row w-full mt-2 ml-5 justify-center bg-white">
                {navbar}
            </div>
        </div>
    )
}
export default MenuBar;
